import React from 'react';
import ReactDOM from 'react-dom/client';
import { Router, Route, Link, HashRouter, Routes,hashHistory } from 'react-router-dom'
import './index.css';


const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);

class App extends React.Component {
  render () {

    return (
      <div>
        <h1>App</h1>
        <ul>
          <li><Link to="/about" onClick={()=>{console.log("about")}}>About</Link></li>
          <li><Link to="/users/1">Users 1</Link></li>
          <li><Link to="/users/2">Users 2</Link></li>
        </ul>
        {this.props.children} 
        hha
      </div>
    );
  }
}

class About extends React.Component {
  render () {
    console.log("about")
    return (<h1>About</h1>);
  }
}

class Users extends React.Component {
  render () {
    const id = this.props.params.userId;
    console.log(id)
    return (
      <div>
        user id: {id}
      </div>
    )
  }
}


root.render(
  (
    <Router history={hashHistory}>
      <Routes>
        <Route path="/" element={<App />}>
          <Route path="about" element={<About />} component = {About}/>
          <Route path="users/:userId" element={<Users />} component={Users} />
        </Route>
      </Routes>

    </Router>
  )
);
